import React from 'react';

const style = `
.btn-portfolio {
  border: 1px solid white;
  border-radius: 5px;
}
`;

const Buttons = () => {
  return (
    <div className="btn-portfolio">
      <div>C</div>
      <div>Facebook</div>
    </div>
  );
};

export default Buttons;
